require('@tensorflow/tfjs');
const handpose = require('@tensorflow-models/handpose');
const { JSDOM } = require('jsdom');


class HandPosePredictor {
    constructor () {
        this.model = null;
    }

    async loadModel() {
        if (!this.model) {
            this.model = await handpose.load();
        }
    }

    async predict(image) { // imageBase64 should be a Base64-encoded image string.
        await this.loadModel();

        const dom = new JSDOM('<!DOCTYPE html><body></body></html>');
        
        return new Promise((resolve, reject) => {
            const imgElement = dom.window.document.createElement('img');
            imgElement.onload = async () => {
                const predictions = await this.model.estimateHands(imgElement);

                if (predictions.length > 0) {
                    for (let i = 0; i < predictions.length; i++) {
                        const keypoints = predictions[i].landmarks;

                        // Log hand keypoints.
                        for (let j = 0; j < keypoints.length; j++) {
                            console.log(`Keypoint ${j}:`,
                                keypoints[j][0], keypoints[j][1], keypoints[j][2]);
                        }
                    }
                    resolve(predictions);
                } else {
                    console.log('No hands detected');
                    resolve(null);
                }
            };
            imgElement.onerror = reject;
            
            // Load the image from the Base64 string.
            imgElement.src=image;
        });
    }
}


module.exports = HandPosePredictor;

